result:
.applyForApi {
    width: 100%;
    padding: 20px;
    .title {
        border-radius: 8px;
        background: #79ac43;
        color: #fff;
        cursor: default;
    }
    .el-button {
        background: #79ac43;
        border-radius: 8px;
        color: #fff;
    }
    .apply {
        width: 530px;
        .el-button {
            width: 80px;
        }
        .apiName {
            display: flex;
            justify-content: space-between;
            .el-input {
                width: 150px;
                margin: 0 8px;
            }
        }
        .params {
            span {
                display: flex;
                padding-left: 80px;
                margin-bottom: 8px;
                .el-input {
                    width: 150px;
                    margin: 0 24px 0 12px;
                }
            }
        }
        .btns {
            width: 70%;
            margin-top: 50px;
            display: flex;
            justify-content: space-around;
            align-items: center;
        }
        .upload-demo {
            margin-left: 50px;
            .el-button {
                margin: 14px 0 0 0;
                height: 28px;
                line-height: 0;
            }
        }
    }
}
